	<script>
		function toggleVisibility(id, buttonEl) {
			const plotEl = document.getElementById(id);
			const isVisible = plotEl.style.display !== 'none';

			plotEl.style.display = isVisible ? 'none' : '';
			buttonEl.textContent = isVisible ? 'Show' : 'Hide';
		}

		function toggleScale(id, buttonEl) {
			const current = buttonEl.textContent.toLowerCase();
			const newScale = current === 'lin' ? 'log' : 'linear';

			Plotly.relayout(id, {
				'yaxis.type': newScale,
				'yaxis.autorange': true
			}).then(() => {
				buttonEl.textContent = newScale === 'linear' ? 'Lin' : 'Log';
			}).catch(err => {
				console.error("Scale toggle failed:", err);
				alert("Could not switch scale. Ensure all Y values are > 0 for log.");
			});
		}

		function moveDown(id) {
			const wrapper = document.querySelector(`[data-panel-id="${id}"]`);
			const container = document.getElementById("plot-container");

			if (!wrapper || wrapper.parentNode !== container) return;

			const next = wrapper.nextElementSibling;
			if (!next) return;

			container.insertBefore(wrapper, next.nextElementSibling);
		}

		function moveUp(id) {
			const wrapper = document.querySelector(`[data-panel-id="${id}"]`);
			const container = document.getElementById("plot-container");

			if (!wrapper || wrapper.parentNode !== container) return;

			const prev = wrapper.previousElementSibling;
			if (prev) container.insertBefore(wrapper, prev);
		}

		function makeLayout(title, scale) {
			return {
				title: { text: title, font: { size: 14 } },
				margin: { l: 50, r: 30, t: 30, b: 30 },

				showlegend: true,

					title: "Y Axis 1",

				},

					title: "Y Axis 2",
					type: scale,
					overlaying: "y",
					side: "right"
				}
			};
		}

			const others = plots.filter(id => id !== sourceId);

			sourceEl.on('plotly_relayout', e => {

				if (e['xaxis.range[0]'] && e['xaxis.range[1]']) {
					const range = [e['xaxis.range[0]'], e['xaxis.range[1]']];
					others.forEach(targetId => {

						Plotly.relayout(targetId, { 'xaxis.range': range }).then(() => {
							isSyncing[targetId] = false;
						});

					others.forEach(targetId => {
